INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "キャル", 7001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 106001, 0.0, 7, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "コッコロ", 7002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105901, 0.0, 7, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "ペコリーヌ", 7003, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105801, 0.0, 7, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "ペコリーヌ", 10001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105801, 0.0, 10, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "キャル", 10002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 106001, 0.0, 10, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "コッコロ", 10003, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105901, 0.0, 10, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "シェフィ", 10004, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", 0.0, 2104010, 106401, 0.0, 10, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, 0, "ペコリーヌ", 12001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105801, 0.0, 12, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "キャル", 13001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 106001, 0.0, 13, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "コッコロ", 13002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105901, 0.0, 13, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "シェフィ", 13003, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", 0.0, 2104010, 106401, 0.0, 13, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "ペコリーヌ", 13004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105801, 0.0, 13, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "コッコロ", 14001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105901, 0.0, 14, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "シェフィ", 14002, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", 0.0, 2104010, 106401, 0.0, 14, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "ペコリーヌ", 14003, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105801, 0.0, 14, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "キャル", 14004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 106001, 0.0, 14, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-470.0, 0, "コッコロ", 15001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105901, 0.0, 15, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "シェフィ", 16001, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", 0.0, 2104010, 106401, 0.0, 16, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "ペコリーヌ", 16002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105801, 0.0, 16, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "キャル", 16003, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 106001, 0.0, 16, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "コッコロ", 16004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105901, 0.0, 16, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "コッコロ", 17002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105901, 0.0, 17, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "キャル", 17004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 106001, 0.0, 25, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "コッコロ", 17005, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105901, 0.0, 25, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "シェフィ", 17006, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", 0.0, 2104010, 106401, 0.0, 25, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "ペコリーヌ", 17007, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105801, 0.0, 25, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "カリン", 18001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 190801, 0.0, 18, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "カリン", 18002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 190801, 0.0, 18, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 2, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-470.0, 0, "カリン", 19001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 190801, 0.0, 19, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 3, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-470.0, 0, "カリン", 19002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 190801, 0.0, 19, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 4, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-470.0, 0, "カリン", 20001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 190801, 0.0, 20, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 5, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-470.0, 0, "カリン", 20002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 190801, 0.0, 20, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 6, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "キャル", 21001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 106001, 0.0, 21, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "コッコロ", 21002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105901, 0.0, 21, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "シェフィ", 21003, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", 0.0, 2104010, 106401, 0.0, 21, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "ペコリーヌ", 21004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105801, 0.0, 21, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-430.0, 0, "カリン", 22001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 190801, 0.0, 22, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-430.0, 0, "カリン", 22002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 190801, 0.0, 22, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 2, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-430.0, 0, "カリン", 23001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 190801, 0.0, 23, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 3, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-430.0, 0, "カリン", 23002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 190801, 0.0, 23, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 4, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, 10011, "エリコ（バレンタイン）", 24001, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 8.0, 0, 109001, 4.08, 24, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, 10011, "エリコ（バレンタイン）", 24002, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 8.0, 0, 109001, 5.0, 24, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 2, 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, 10011, "エリコ（バレンタイン）", 24003, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 8.0, 0, 109001, 10.11, 24, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 3, 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, 10011, "エリコ（バレンタイン）", 24004, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 8.0, 0, 109001, 4.0, 24, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4, 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, 10011, "エリコ（バレンタイン）", 24005, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 8.0, 0, 109001, 6.0, 24, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 5, 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 10011, "エリコ（バレンタイン）", 24006, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 0.0, 0, 109002, 0.0, 24, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 6, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 10011, "エリコ（バレンタイン）", 24007, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 0.0, 0, 109002, 0.0, 24, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 7, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 10011, "エリコ（バレンタイン）", 24008, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 0.0, 0, 109002, 0.0, 24, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 8, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 10011, "エリコ（バレンタイン）", 24009, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 0.0, 0, 109002, 0.0, 24, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 9, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 10011, "エリコ（バレンタイン）", 24010, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 0.0, 0, 109002, 0.0, 24, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 10, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, 10011, "シズル（バレンタイン）", 24011, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 8.0, 0, 109101, 2.12, 24, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, 10011, "シズル（バレンタイン）", 24012, "2030/12/17 14:59:59", 5, "2019/01/31 12:00:00", 8.0, 0, 109101, 4.19, 24, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 2, 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, 10011, "シズル（バレンタイン）", 24013, "2030/12/17 14:59:59", 2, "2019/01/31 12:00:00", 8.0, 0, 109101, 2.3, 24, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 3, 4);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 10011, "シズル（バレンタイン）", 24014, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 0.0, 0, 109102, 0.0, 24, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 4, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, 10011, "シズル（バレンタイン）", 24015, "2030/12/17 14:59:59", 5, "2019/01/31 12:00:00", 8.0, 0, 109101, 5.23, 24, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 10011, "シズル（バレンタイン）", 24016, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 0.0, 0, 109102, 0.0, 24, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 6, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, 10011, "シズル（バレンタイン）", 24017, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 8.0, 0, 109101, 5.01, 24, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 7, 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 10011, "シズル（バレンタイン）", 24018, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 0.0, 0, 109102, 0.0, 24, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 8, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 10011, "シズル（バレンタイン）", 24019, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 0.0, 0, 109102, 0.0, 24, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 9, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 10011, "シズル（バレンタイン）", 24020, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", 0.0, 0, 109102, 0.0, 24, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 10, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "シェフィ", 26001, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", 0.0, 2104010, 106401, 0.0, 26, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "ペコリーヌ", 26002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105801, 0.0, 26, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "キャル", 26003, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 106001, 0.0, 26, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "コッコロ", 26004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105901, 0.0, 26, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "シェフィ", 27001, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", 0.0, 2104010, 106401, 0.0, 27, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "ペコリーヌ", 27002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105801, 0.0, 27, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "キャル", 27003, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 106001, 0.0, 27, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "コッコロ", 27004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105901, 0.0, 27, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "カリン", 28001, "2030/12/17 14:59:59", 1, "2019/09/24 15:00:00", 0.0, 0, 190801, 0.0, 28, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "カリン", 28002, "2030/12/17 14:59:59", 1, "2019/09/24 15:00:00", 0.0, 0, 190801, 0.0, 28, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", 2, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, 0, "カリン", 29001, "2030/12/17 14:59:59", 1, "2019/09/24 15:00:00", 0.0, 0, 190801, 0.0, 29, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", 3, 1);
