INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, 0, "カリン", 30001, "2030/12/17 14:59:59", 1, "2019/09/24 15:00:00", 0.0, 0, 190801, 0.0, 30, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", 5, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, 0, "カリン", 30002, "2030/12/17 14:59:59", 1, "2019/09/24 15:00:00", 0.0, 0, 190801, 0.0, 30, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", 6, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, 0, "カリン", 31001, "2030/12/17 14:59:59", 1, "2019/10/31 12:00:00", 0.0, 0, 190801, 0.0, 31, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 7, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, 0, "カリン", 31002, "2030/12/17 14:59:59", 1, "2019/10/31 12:00:00", 0.0, 0, 190801, 0.0, 31, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 8, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, 0, "カリン", 32001, "2020/01/04 4:59:59", 1, "2019/12/20 5:00:00", 0.0, 0, 190801, 0.0, 32, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", 1, 1);
