INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, 0, "カリン", 33002, "2020/01/04 4:59:59", 1, "2019/12/20 5:00:00", 0.0, 0, 190801, 0.0, 33, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 4, 1);
