INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-430.0, 0, "カリン", 40001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 190801, 0.0, 40, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", 2, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "シェフィ", 41001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 2104010, 106401, 0.0, 41, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "ペコリーヌ", 41002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105801, 0.0, 41, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "キャル", 41003, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 106001, 0.0, 41, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "コッコロ", 41004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105901, 0.0, 41, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, 0, "コッコロ", 42001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105901, 0.0, 42, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, 0, "シェフィ", 42002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 2104010, 106401, 0.0, 42, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, 0, "ペコリーヌ", 42003, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105801, 0.0, 42, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, 0, "キャル", 42004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 106001, 0.0, 42, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "ペコリーヌ", 43001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105801, 0.0, 43, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "コッコロ", 43002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 105901, 0.0, 43, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, 0, "キャル", 43003, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 106001, 0.0, 43, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, 0, "アメス", 43004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 123001, 0.0, 44, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 1, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, 0, "アメス", 43005, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 123001, 0.0, 44, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 2, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, 0, "アメス", 43006, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", 0.0, 0, 123001, 5.79, 45, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 3, 2);
